var util=require("../"),should=require("should"),path=require("path"),es=require("event-stream");require("mocha");describe("noop()",function(){it("should return a stream",function(e){util.isStream(util.noop()).should.equal(!0);e()});it("should return a stream that passes through all data",function(e){var t=[1,2,3,4,5,6,7,8,9],n=util.noop();es.readArray(t).pipe(n).pipe(es.writeArray(function(n,r){should.not.exist(n);should.exist(r);r.should.eql(t);e()}))})});